//Create a button for a user in the user selection modal. Selecting the button makes the user active
function createUserButton(user, highlight) {
    var delUser = document.createElement('button');
    $(delUser).attr({'id':user.userId,'value':user.username,'type':'button'}).addClass('btn btn-danger').text("X").click(function(){
        var deleteUser = confirm("Are you sure you want to delete " + $(this).val() + "'s student profile from this device?");
        if (deleteUser) {
            window.localStorage.removeItem($(this).val());
            for (index in Users) {
                if (Users[index].userId == $(this).attr('id')) {
                    Users.splice(index, 1);
                    window.localStorage.setItem('Users', JSON.stringify(Users))
                    break;
                }
            }
            $('#' + $(this).attr('id')).remove();
            $('#' + $(this).attr('id')).remove();
        }
    });
    var userButton = document.createElement('button');
    $(userButton).attr({'id':user.userId,'type':'button'}).addClass('btn user-btn btn-default').text(user.username).click(function(){
        $('.user-btn').removeClass('btn-success');
        getUser($(this).attr('id'), null, false);
        $(this).addClass('btn-success');
        $('#infoClose').show();
    });
    if (highlight) {
        $('.user-btn').removeClass('btn-success');
        $(userButton).addClass('btn-success');
        $('#infoClose').show();
    }
    $('#userlist').append("<p>", userButton, delUser, "</p>");
}

//Creates a new user onClick
function addUser() {
	if ($('#newUserName').val() != '') {
		getUser(null, $('#newUserName').val(), true);
		$('#newUserName').val('');
	}
}

